import React from 'react';
import { Link } from 'react-router-dom';

const RouteManager = ({ routes, onEditRoute, onDeleteRoute }) => {
  return (
    <div>
      <h2>Route Manager</h2>
      {routes.map(route => (
        <div key={route._id} className="mb-4 p-4 border rounded">
          <h3>{route.name}</h3>
          <p>Customers: {route.customers.length}</p>
          <button onClick={() => onEditRoute(route)}>Edit</button>
          <button onClick={() => onDeleteRoute(route._id)}>Delete</button>
        </div>
      ))}
      <Link to="/build-routes">Back to Route Builder</Link>
    </div>
  );
};

export default RouteManager;
